import { Grid ,Container} from '@mui/material'
import Cards from './molecules/Cards';
import COMPLETED from './completed';
import MyCard from './molecules/MyCard';
function FinishedBooks(){
    return (
      <Container style={{paddingLeft:"7%",paddingRight:"7%"}}>
      <Grid container rowSpacing={2} spacing={4}>
        {COMPLETED.map(book=> (<Grid item xs={12} sm={6} md={4}>
          <MyCard id={book.id} key={book.id} src={book.src} name={book.name} author={book.author} duration={book.duration} progressBar='full' button='Read again'/>
        </Grid>
        ))}        
      </Grid>
      </Container>
    );
}
export default FinishedBooks;
